import base64
import codecs

dec_str = """
"""

decimal_text = base64.b64decode(dec_str).decode()
nums = [int(x) for x in decimal_text.split()]
b64_again = "".join(chr(n) for n in nums)

hex_escaped = base64.b64decode(b64_again).decode().strip()
final_text = codecs.decode(hex_escaped, "unicode_escape")

print(final_text)

